INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'After graduating from the University of Denver with a B.S. in Psychology I served two years in the Israeli Defense Forces, stationed in the West Bank. Having grown up in Chicago, studied in Denver and Budapest, and served in Israel I''m now living in Portland, Oregon. Currently attending Epicodus coding boot camp for PHP and Drupal with the hope of becoming a Web Developer.\r\n\r\n<center><strong>CV</strong></center>\r\n\r\n<div class=''resume-header''>EDUCATION</div>\r\nUniversity of Denver, Denver, CO\r\nB.S. Psychology – Graduated 2012\r\nMinors in Business & Biology\r\n\r\n<div class=''resume-header''>TECHNICAL SKILLS</div>\r\n<center>HTML ~ CSS ~ Javascript ~ PHP ~ PSQL ~ PostGres ~ jQuery ~ AngularJS</center>\r\n<br>\r\n\r\n<div class=''resume-header''>RECENT EXPERIENCE</div>\r\nEpicodus    |    Web Development Bootcamp    |    March-June 2015\r\n\r\n\r\nIsraeli Defense Forces (IDF)    |    Nahal Infantry Battalion, Company 931, Spear Platoon    |    2012-2014\r\n\r\nTeam Leader, Lead Navigator/Scout\r\nResponsible for leading members of my team; bridged gaps in culture with leading by example to function as a cohesive unit\r\nMaintained the highest level of organization and attention to detail\r\nWorked under extreme stress, quickly responding to security threats\r\nCreative problem solving\r\nLearned to operate in Hebrew with no previous knowledge\r\nMental and physical perseverance and resilience\r\nImpeccable work ethic in a 24/7 job\r\n\r\n<div class=''resume-header''>WORK EXPERIENCE</div>\r\n<strong>J.Crew    |    Sales Associate    |    June 2011-March 2012</strong>\r\nLearned skills in retail operations, client management and sales\r\nExceeded daily and quarterly sales goals\r\nKnowledgeable in menswear and finding products to suit client needs\r\n\r\n\r\n<strong>Work Study    |    Research Assistant    |    October 2008-June 2012</strong>\r\nAutomaticity, Affect, Control & Thought Lab\r\nData entry and filing, including work with SPSS software\r\nPrepared samples, ran gel analysis and PCR protocols, and prepared results\r\nReceived International Review Board certification\r\n\r\n<strong>Granite Transformations    |    Showroom Manager    |    June-September 2010</strong>\r\nResponsible for opening and closing showroom\r\nExpert product knowledge displayed to customers\r\nScheduling appointments and maintaining relationship with customers\r\n\r\n<strong>University of Denver    |    Orientation Leader    |    Fall 2009 and Fall 2011</strong>\r\nLed 15 Freshman through their first week in college\r\nAdvised and mentored students through effective leadership, organization, and communication\r\n\r\n<div class=''resume-header''>ACTIVITIES</div>\r\nSigma Chi Fraternity\r\nInitiated Fall 2008\r\n\r\nSteward, responsible for organizing and purchasing food and catering\r\nBuilt strong foundation of leadership and character', '', 'full_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'After graduating from the University of Denver with a B.S. in Psychology I served two years in the Israeli Defense Forces, stationed in the West Bank. Having grown up in Chicago, studied in Denver and Budapest, and served in Israel I''m now living in Portland, Oregon. Currently attending Epicodus coding boot camp for PHP and Drupal with the hope of becoming a Web Developer.', '', 'filtered_html'),
('node', 'article', 0, 5, 5, 'und', 0, 'Epifoodus, is an application that randomly suggests restaurants for the user. The mission is that when you''re too hungry to make decisions Epifoodus will randomly give you options. Users can create a profile with password and save preferences.\r\n\r\nThis project uses PHP, PSQL, HTML, CSS, and Boostrap.\r\n\r\n<a href=''epifoodus.herokuapp.com''>Check out the project!</a>\r\n\r\nThe timeline for this project was a week, and one of the things that we never had time to figure out was implementing a Google API, or a Yelp API (I''m assuming there is one), to generate the restaurants closest to the users location. Right now we simply are tailoring the app to only Epicodus students. So we populated the database ourselves with restaurants and food carts within walking distance of Epicodus.', '', 'filtered_html'),
('node', 'article', 0, 6, 6, 'und', 0, 'This site uses JavaScript and jQuery to take an inputted string, and return the string in title case. The functionality is simple, but I was able to use a Regular Expression to find/replace the specific characters that needed to be uppercased. The two Regular Expressions accomplish what previously took several lines of code.\r\n\r\n<a href=''github.com/evanb2/titleCaseJS''>Here''s the repository.</a>\r\n\r\n<a href=''titlecase.site44.com''>Here''s the MakeTitle site.</a>', '', 'filtered_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<div id=''recentprojects-ajax-wrapper''><p><center>Click Above.</center></p></div>', '', 'full_html'),
('node', 'page', 0, 10, 10, 'und', 0, '<div id=''books-ajax-wrapper''><p><center>Click on a Book.</center></p></div>', '', 'full_html'),
('node', 'book', 0, 11, 11, 'und', 0, '"He watches, pale and unwashed. He can neither read nor write and in him broods already a taste for mindless violence. All history present in that visage, the child the father of the man."', '', 'filtered_html'),
('node', 'book', 0, 12, 12, 'und', 0, '"Look…reality is greater than the sum of its parts, also a damn sight holier. And the lives of such stuff as dreams are made of may be rounded with sleep but they are not tied neatly with a red bow. Truth doesn’t run on time like a commuter train, though time may run on truth. And the Scenes Gone By and the Scenes To Come flow blending together in the sea-green deep while Now spreads in circles on the surface. So don’t sweat it. For focus simply move a few inches back or forward."', '', 'full_html'),
('node', 'book', 0, 13, 13, 'und', 0, '"And yet I knew that what I saw wasn’t as simple and good as it appeared. There was a price to be paid for all of it, a general falsity, that could be easily believed, and could be the first step down a dead-end street."', '', 'full_html');
