INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' about after graduating from the university of denver with a bs in psychology i served two years in the israeli defense forces stationed in the west bank having grown up in chicago studied in denver and budapest and served in israel i m now living in portland oregon currently attending epicodus coding boot camp for php and drupal with the hope of becoming a web developer cv education university of denver denver co bs psychology graduated 2012 minors in business biology technical skills html css javascript php psql postgres jquery angularjs recent experience epicodus web development bootcamp marchjune 2015 israeli defense forces idf nahal infantry battalion company 931 spear platoon 20122014 team leader lead navigator scout responsible for leading members of my team bridged gaps in culture with leading by example to function as a cohesive unit maintained the highest level of organization and attention to detail worked under extreme stress quickly responding to security threats creative problem solving learned to operate in hebrew with no previous knowledge mental and physical perseverance and resilience impeccable work ethic in a 247 job work experience jcrew sales associate june 2011march 2012 learned skills in retail operations client management and sales exceeded daily and quarterly sales goals knowledgeable in menswear and finding products to suit client needs work study research assistant october 2008june 2012 automaticity affect control thought lab data entry and filing including work with spss software prepared samples ran gel analysis and pcr protocols and prepared results received international review board certification granite transformations showroom manager juneseptember 2010 responsible for opening and closing showroom expert product knowledge displayed to customers scheduling appointments and maintaining relationship with customers university of denver orientation leader fall 2009 and fall 2011 led 15 freshman through their first week in college advised and mentored students through effective leadership organization and communication activities sigma chi fraternity initiated fall 2008 steward responsible for organizing and purchasing food and catering built strong foundation of leadership and character  ', 0),
(2, 'node', ' welcome after graduating from the university of denver with a bs in psychology i served two years in the israeli defense forces stationed in the west bank having grown up in chicago studied in denver and budapest and served in israel i m now living in portland oregon currently attending epicodus coding boot camp for php and drupal with the hope of becoming a web developer  ', 0),
(5, 'node', ' epifoodus epifoodus is an application that randomly suggests restaurants for the user the mission is that when you re too hungry to make decisions epifoodus will randomly give you options users can create a profile with password and save preferences this project uses php psql html css and boostrap check out the project  the timeline for this project was a week and one of the things that we never had time to figure out was implementing a google api or a yelp api i m assuming there is one to generate the restaurants closest to the users location right now we simply are tailoring the app to only epicodus students so we populated the database ourselves with restaurants and food carts within walking distance of epicodus coding project php javascript css postgresql epicodus ', 0),
(6, 'node', ' maketitle this site uses javascript and jquery to take an inputted string and return the string in title case the functionality is simple but i was able to use a regular expression to find replace the specific characters that needed to be uppercased the two regular expressions accomplish what previously took several lines of code here s the repository here s the maketitle site coding project epicodus javascript jquery regex ', 0),
(7, 'node', ' project  click above  ', 0),
(9, 'node', ' to being well versed in all things ', 0),
(10, 'node', ' books click on a book  ', 0),
(11, 'node', ' blood meridian  he watches pale and unwashed he can neither read nor write and in him broods already a taste for mindless violence all history present in that visage the child the father of the man  ', 0),
(12, 'node', ' sometimes a great notion  look reality is greater than the sum of its parts also a damn sight holier and the lives of such stuff as dreams are made of may be rounded with sleep but they are not tied neatly with a red bow truth doesn t run on time like a commuter train though time may run on truth and the scenes gone by and the scenes to come flow blending together in the seagreen deep while now spreads in circles on the surface so don t sweat it for focus simply move a few inches back or forward  ', 0),
(13, 'node', ' ham on rye  and yet i knew that what i saw wasn t as simple and good as it appeared there was a price to be paid for all of it a general falsity that could be easily believed and could be the first step down a deadend street  ', 0);
